import React from "react";
import {Link} from "react-router-dom";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

import withContext from "../withContext";

const HomePage = props => {

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    arrows: false,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  const slides = [
      {
          id : 0, info : "test0", path : "/images/image1.jpg"
      },
      {
          id : 1, info : "test1", path : "/images/image2.jpg"
      },
      {
          id : 2, info : "test2", path : "/images/image3.jpg"
      },
      {
          id : 3, info : "test3", path : "/images/image4.jpg"
      },
      {
          id : 4, info : "test4", path : "/images/image5.jpg"
      },
      {
          id : 5, info : "test5", path : "/images/image6.jpg"
      },
      {
          id : 6, info : "test6", path : "/images/JAMPRO.jpeg"
      },
  ];

  return (
    <>
      <div className="hero">
        <div className="box" style={{padding:"0"}}>
          <div className="columns">
            <div className="column is-two-third">
            <div className="box">
              2
              <Slider {...settings}>
                  {slides.map((slide) => 
                      <div key={slide.id}>
                          <img className="slick-slide-image customSlide" 
                            name={slide.id} alt={slide.id} src={slide.path}>
                          </img>
                          <h1 className="title slide-info">{slide.info}</h1>
                      </div>
                  )}
              </Slider>
          </div>

            </div>
            <div className="column is-one-third">
              1
            </div>

          </div>
        </div> 
        <br />
        HomePage
        <br />
        <Link to="/postings"> <button>Information Bulletin</button> </Link>
      </div>
    </>
  );
};

export default withContext(HomePage);
